import React from 'react';
import { BrowserRouter, Route } from 'react-router-dom';
import '../scss/custom.scss';

import Navigation from './Navigation';

const PageOne = () => {
  return <div>P1</div>;
}

const PageTwo = () => {
  return <div>P2</div>;
}

function App() {
  return (

    <div>
    <Navigation />
      <BrowserRouter>
        <Route path="/" exact component={PageOne} />
        <Route path="/" exact component={PageTwo} />
      </BrowserRouter>
    </div>
  );
}

export default App;
